/* Default */
import React from 'react'

/* Packages */
import { NormalizeCss, Box, Flex } from 'react-bee'

const App = () => {
  return (
    <>
      <NormalizeCss />
      <Box>
        <Flex style={{ background: 'red' }} justifyContent='space-between'>
          <TestTrack index={1} background='yellow' />
          <TestTrack index={2} background='cyan' />
          <TestTrack index={3} background='pink' />
        </Flex>
      </Box>
    </>
  )
}

export default App

const TestTrack = ({ index, background }) => (
  <p style={{ background: background }}>{index}</p>
)
